sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
	if(inputs.status_code == '200'){
      	outputs.response = JSON.parse(inputs.response_body)['data']['statewise'];
      	outputs.total_states = outputs.response.length;
      	outputs.response_string = JSON.stringify(outputs.response);
      	outputs.states_data = outputs.response;
    }
})(inputs, outputs);

